import './App.css';
import TodoList from './component/TodoList';

function App() {
  return (
    <>
      <div className='container-fluid'>
        <div className='row vh-100 justify-content-center align-items-center'>
          <TodoList />
        </div>
      </div>
    </>
  );
}

export default App;
